import { defer } from "react-router-dom";
import "../Styles/main.css";
import "../Styles/Media-Queries.css";
import Links from "../Components/Footer/Links";
import Redes from "../Components/Footer/Redes";
import Header from "../Components/Header/Header";
const Proyects=()=>{
    return(
        <div>
            <Header/>
            <main className="proyects-main">
                <h1>PROYECTOS</h1>
                <section className="proyects-container">
                    <a href="https://u3405-ukemochi-frontend-app.vercel.app/"> <img src="https://ibb.co/NFv6M0G" alt="UkeMochi" /></a>
                    <a href="https://gehiner.github.io/"> <img src="https://ibb.co/hKvC071" alt="Blog-Github" /></a>
                    <a href="https://gitlab.com/05401/vuelafacil"> <img src="https://ibb.co/jGkXnTp" alt="Vuela Facil" /></a>
                    <a href="https://github.com/Gehiner/Yard-Sale-Curso-Practico-Platzi"> <img src="https://i.ibb.co/7Xr5Nwc/YardSale.webp" alt="Yard-Sale" /></a>
                    <a href="https://github.com/Gehiner/BataBit-Platzi"> <img src="https://ibb.co/4jjTg4H" alt=" Batatabit" /></a>
                    <a href="https://github.com/Gehiner/Viking"> <img src="https://ibb.co/YBKqhYk" alt="Vikingo" /></a>
                    <a href="https://github.com/Gehiner/GridPractica"> <img src="https://ibb.co/FhdmQHD" alt="Proyecto-Plazti" /></a>
                </section>
            </main>
            <footer>
                <Links></Links>
                <Redes></Redes>
            </footer>
        </div>
    )
};

export default Proyects;
